import styles from "./Card.module.css"

export default function Card({name, species, gender, image, onClose}) {
   return (
      <div className={styles.card}>
         <button className={styles.button}onClick={onClose}>X</button>
         <h2 className={styles.h2}>name: {name}</h2>
         <h2 className={styles.h2}>species: {species}</h2>
         <h2 className={styles.h2}>gender: {gender}</h2>
         <img className={styles.card} src={image} alt="" />
      </div>
   );
}
